import React from "react";
import ProductivityGrid from "../components/ProgessBar";
import WebcamCapture from "../components/WebcamCapture";

const Dashboard = () => {
  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-4">Student Productivity</h2>
      <ProductivityGrid />
      <h2 className="text-2xl font-bold mt-6">Live Monitoring</h2>
      <WebcamCapture />
    </div>
  );
};

export default Dashboard;
